DECLARE 
    v_Crnt_Bld_Version         Varchar2(25);
    v_Crnt_Release_Version     Varchar2(25);
    v_Application_Type         Varchar2(25);
    v_Obj_Version              Varchar2(25);
    v_Create_Update_User       Varchar2(30);
    Crnt_Objname               Varchar2(30);
    Crnt_Objtype               Varchar2(30);
    Crnt_Action                Varchar2(25);
    v_Remarks                  Varchar2(4000);
    v_Cvs_Version              Varchar2(25); 
    v_Status                   Varchar2(25);
    v_Error_Msg                Varchar2(4000); 
	V_Cnt                      Number;
    Seeddata_Table             Pkg_Sa_Manage_Builds.Seeddata_Table := Pkg_Sa_Manage_Builds.Seeddata_Table();	
BEGIN
  SELECT COUNT(*)
    INTO V_Cnt
    FROM USER_TABLES
   WHERE TABLE_NAME = 'SF_SYSTEM_PARAMETERS';

  IF V_CNT = 0 THEN	

	Begin
    Select Osuser Into v_Create_Update_User From V$session
     Where Audsid = Userenv('SESSIONID')
     And Rownum <= 1;	  
	 
    Crnt_Objname           := 'SI_INTERFACES';  
    v_Application_Type     := 'CMM-PMD-INT';
    Crnt_Objtype           := 'SEED_DATA';
    v_Cvs_Version          := trim(substr('$Revision: 1.36 $',(instr('$Revision: 1.36 $',':')+2),((instr('$Revision: 1.36 $','$',1,2)-1) - (instr('$Revision: 1.36 $',':')+1))));
  
    If (Pkg_Sa_Manage_Builds.Fn_Is_Prerequisites_Exists AND
      NOT Pkg_Sa_Manage_Builds.Fn_Is_Object_With_Err) THEN
		
		Begin       -- All Releases Block
            Begin     -- Block of CMM-PMD-INTv100 for All Builds
                v_Crnt_Release_Version  := '100';
                Begin   -- Block of CMM-PMD-INTv100 First Build
                    v_Crnt_Bld_Version      := '1';
                    Begin
                        v_Obj_Version           := '1.1';
                        Crnt_Action             := 'INSERT';
                        Seeddata_Table.Extend(4);
                        
                        Seeddata_Table(1).Sql_Statement := q'[INSERT INTO SI_INTERFACES (INTERFACE_SEQ,
                                                                   INTERFACE_ID,
                                                                   DESCRIPTION,
                                                                   CREATE_USER,
                                                                   CREATE_DATE)
                                           SELECT   SI_INTERFACE_SEQ.NEXTVAL INTERFACE_SEQ,
                                                    'CLINAPPS-INTERFACES' INTERFACE_ID,
                                                    'Base Framework for Interfaces as part of War deployment'
                                                       DESCRIPTION,
                                                    USER,
                                                    SYSDATE
                                             FROM   DUAL
                                            WHERE   NOT EXISTS (SELECT   'X'
                                                                  FROM   SI_INTERFACES
                                                                 WHERE   INTERFACE_ID = 'CLINAPPS-INTERFACES')]';
                        Seeddata_Table(1).Unique_Column_Value := 'CLINAPPS-INTERFACES';
                        Seeddata_Table(1).Action := 'INSERT';
                        
                        Seeddata_Table(2).Sql_Statement := q'[INSERT INTO SI_INTERFACES (INTERFACE_SEQ,
                                                                   INTERFACE_ID,
                                                                   DESCRIPTION,
                                                                   CREATE_USER,
                                                                   CREATE_DATE)
                                           SELECT   SI_INTERFACE_SEQ.NEXTVAL INTERFACE_SEQ,
                                                    'CTMS' INTERFACE_ID,
                                                    'Creates Programs, Trials, Sites and maintaines Trial Personnel along with Addresses.'
                                                       DESCRIPTION,
                                                    USER,
                                                    SYSDATE
                                             FROM   DUAL
                                            WHERE   NOT EXISTS (SELECT   'X'
                                                                  FROM   SI_INTERFACES
                                                                 WHERE   INTERFACE_ID = 'CTMS')]';
                        Seeddata_Table(2).Unique_Column_Value := 'CTMS';
                        Seeddata_Table(2).Action := 'INSERT';
                        
                        Seeddata_Table(3).Sql_Statement := q'[INSERT INTO SI_INTERFACES (INTERFACE_SEQ,
                                                               INTERFACE_ID,
                                                               DESCRIPTION,
                                                               CREATE_USER,
                                                               CREATE_DATE)
                                       SELECT   SI_INTERFACE_SEQ.NEXTVAL INTERFACE_SEQ,
                                                'DI-DR' INTERFACE_ID,
                                                'Creates Shipment/Transfers Request and Shipment/Transfer Execution records.'
                                                   DESCRIPTION,
                                                USER,
                                                SYSDATE
                                         FROM   DUAL
                                        WHERE   NOT EXISTS (SELECT   'X'
                                                              FROM   SI_INTERFACES
                                                             WHERE   INTERFACE_ID = 'DI-DR')]';
                        Seeddata_Table(3).Unique_Column_Value := 'DI-DR';
                        Seeddata_Table(3).Action := 'INSERT';
                        
                        Seeddata_Table(4).Sql_Statement := q'[INSERT INTO SI_INTERFACES (INTERFACE_SEQ,
                                                               INTERFACE_ID,
                                                               DESCRIPTION,
                                                               CREATE_USER,
                                                               CREATE_DATE)
                                       SELECT   SI_INTERFACE_SEQ.NEXTVAL INTERFACE_SEQ,
                                                'IVR' INTERFACE_ID,
                                                NULL DESCRIPTION,
                                                USER,
                                                SYSDATE
                                         FROM   DUAL
                                        WHERE   NOT EXISTS (SELECT   'X'
                                                              FROM   SI_INTERFACES
                                                             WHERE   INTERFACE_ID = 'IVR')]';
                        Seeddata_Table(4).Unique_Column_Value := 'IVR';
                        Seeddata_Table(4).Action := 'INSERT';
                        
                        Pkg_Sa_Manage_Builds.Pr_Create_Seeddata(Crnt_Objtype, 
                                                                Crnt_Objname,
                                                                v_Obj_Version, 
                                                                Crnt_Action,
                                                                Seeddata_Table,
                                                                v_Crnt_Bld_Version,
                                                                v_Crnt_Release_Version,
                                                                v_Application_Type,
                                                                v_Cvs_Version,
                                                                v_Create_Update_User
                                                               );
                    Exception
                        When Others Then
                            Pkg_Sa_Manage_Builds.Pr_Create_Build_Row(v_Crnt_Bld_Version,
                                                                     v_Crnt_Release_Version,
                                                                     v_Obj_Version,
                                                                     Crnt_Objtype,
                                                                     Crnt_Objname,
                                                                     Crnt_Action,
                                                                     v_Remarks,
                                                                     'ERROR',
                                                                     Substr(Sqlerrm, 1, 3500),
                                                                     v_Application_Type,
                                                                     v_Create_Update_User,
                                                                     v_Cvs_Version
                                                                    );
                    End;
                End; -- Block of CMM-PMD-INTv100 First Build Ends
            End; -- Block of CMM-PMD-INTv100 Release Ends
        End; -- All Releases ends   
    End If; -- Is_Prerequisites_Exists Check ends
End; -- Main End
END IF;
END;
