                                                                      CMM_INT_VERSION,
                                                                      INTERFACE_VERSION,
                                                                      INTERFACE_SEQ,
                                                                      CREATE_USER,
                                                                      CREATE_DATE)
                                       SELECT   SI_CMM_INT_SEQ.NEXTVAL CMM_INT_SEQ,
                                                100 CMM_INT_VERSION,
                                                300 INTERFACE_VERSION,
                                                (SELECT   INTERFACE_SEQ
                                                   FROM   SI_INTERFACES
                                                  WHERE   INTERFACE_ID = 'DI-DR')
                                                   INTERFACE_SEQ,
                                                USER,
                                                SYSDATE
                                         FROM   DUAL
                                        WHERE   NOT EXISTS
                                                   (SELECT   'X'
                                                      FROM   SI_INTERFACES_COMMON
                                                     WHERE       CMM_INT_VERSION = 100
                                                             AND INTERFACE_VERSION = 300
                                                             AND INTERFACE_SEQ = (SELECT   INTERFACE_SEQ
                                                                                    FROM   SI_INTERFACES
                                                                                   WHERE   INTERFACE_ID = 'DI-DR'))]';
                        Seeddata_Table(2).Unique_Column_Value := '100, 300, DI-DR';
                        Seeddata_Table(2).Action := 'INSERT';
                        
                        Seeddata_Table(3).Sql_Statement := q'[INSERT INTO SI_INTERFACES_COMMON (CMM_INT_SEQ,
                                                                  CMM_INT_VERSION,
                                                                  INTERFACE_VERSION,
                                                                  INTERFACE_SEQ,
                                                                  CREATE_USER,
                                                                  CREATE_DATE)
                                   SELECT   SI_CMM_INT_SEQ.NEXTVAL CMM_INT_SEQ,
                                            100 CMM_INT_VERSION,
                                            400 INTERFACE_VERSION,
                                            (SELECT   INTERFACE_SEQ
                                               FROM   SI_INTERFACES
                                              WHERE   INTERFACE_ID = 'IVR')
                                               INTERFACE_SEQ,
                                            USER,
                                            SYSDATE
                                     FROM   DUAL
                                    WHERE   NOT EXISTS
                                               (SELECT   'X'
                                                  FROM   SI_INTERFACES_COMMON
                                                 WHERE       CMM_INT_VERSION = 100
                                                         AND INTERFACE_VERSION = 400
                                                         AND INTERFACE_SEQ = (SELECT   INTERFACE_SEQ
                                                                                FROM   SI_INTERFACES
                                                                               WHERE   INTERFACE_ID = 'IVR'))]';
                        Seeddata_Table(3).Unique_Column_Value := '100, 400, IVR';
                        Seeddata_Table(3).Action := 'INSERT';
                       
                        Pkg_Sa_Manage_Builds.Pr_Create_Seeddata(Crnt_Objtype, 
                                                                Crnt_Objname,
                                                                v_Obj_Version, 
                                                                Crnt_Action,
                                                                Seeddata_Table,
                                                                v_Crnt_Bld_Version,
                                                                v_Crnt_Release_Version,
                                                                v_Application_Type,
                                                                v_Cvs_Version,
                                                                v_Create_Update_User
                                                               );
                    Exception
                        When Others Then
                            Pkg_Sa_Manage_Builds.Pr_Create_Build_Row(v_Crnt_Bld_Version,
                                                                     v_Crnt_Release_Version,
                                                                     v_Obj_Version,
                                                                     Crnt_Objtype,
                                                                     Crnt_Objname,
                                                                     Crnt_Action,
                                                                     v_Remarks,
                                                                     'ERROR',
                                                                     Substr(Sqlerrm, 1, 3500),
                                                                     v_Application_Type,
                                                                     v_Create_Update_User,
                                                                     v_Cvs_Version
                                                                    );
                    End;
                End; -- Block of CMM-PMD-INTv100 First Build Ends
            End; -- Block of CMM-PMD-INTv100 Release Ends
        End; -- All Releases ends   
    End If; -- Is_Prerequisites_Exists Check ends 
End; -- Main End
END IF;
END;
